import React from "react";
import "../../../Styles/Pages/MonsterArena/MonsterVideoCard.scss";
import PlayArrowIcon from "@material-ui/icons/PlayArrow";
import PauseIcon from "@material-ui/icons/Pause";

function MonsterVideoCard() {
  return (
    <div className='monsterVideoCard'>
      <div className='homeHeader__right'>
        <button>
          <PlayArrowIcon />
        </button>
      </div>
      <div className='triangle'></div>
      <div className='monsterCard__title'>
        <p>Monster Fight: Out now on PS5</p>
      </div>
    </div>
  );
}

export default MonsterVideoCard;
